import React, { Component } from "react";
import CardDisplay from "../components/CardDisplay";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = { starWarsList: "" };
  }
  componentDidMount() {
    fetch("https://uifaces.co/api/", {
      method: "GET",
      headers: {
        "X-API-KEY": "",
        Accept: "application/json",
        "Cache-Control": "no-cache",
      },
    })
      .then((resp) => resp.json())
      .then((data) => console.log(data));
  }

  render() {
    return (
      <div className="App">
        {/* <CardDisplay starWarsList={this.state.starWarsList} /> */}
      </div>
    );
  }
}

export default App;
